import React from 'react';

function App() {
  return (
    <div style={{ padding: '50px', fontFamily: 'Arial' }}>
      <h1>Notes App Demo</h1>
      <textarea placeholder="Write your notes here..." style={{ width: '100%', height: '200px' }}></textarea>
    </div>
  );
}

export default App;
